import React from 'react';
import { Tabs, Tab } from 'react-bootstrap';

const TabComponent = () => {
    const tabStyle = {
        position: 'fixed', // O 'absolute' si estás dentro de un contenedor relativo
        top: '50%',
        right: '100px',
        transform: 'translateY(-50%)',
        zIndex: 1000, // Asegura que esté sobre otros elementos
        // otros estilos que necesites
    };

    return (
        <div style={tabStyle}>
            <Tabs defaultActiveKey="filtrosVisuales" id="tab-component" className="mb-3">
                <Tab eventKey="filtrosVisuales" title="Filtros visuales">
                    {/* Contenido de Tab 1 */}
                </Tab>
                <Tab eventKey="barrasPedidos" title="Barras & Pedidos">
                    {/* Contenido de Tab 2 */}
                </Tab>
            </Tabs>
        </div>
    );
};

export default TabComponent;
